import React from "react";
import { Link } from 'react-router-dom';





export const Users = () =>{

    const user = [
        {
            name: 'Adi',
            surname: 'Gonsiore',
            age: 18

        },
        {
            name: 'Seba',
            surname: 'Gonsiore',
            age: 13

        }
    ]



    return(

        <div>
            <button>
                <Link to={`/users/${user.name}`}>
                    {user.name}

                </Link>
            </button>


        </div>
    )
}
